import React from 'react';

 class pageselector extends React.Component{
    constructor(){
        super();
        this.state={
            selectpage : true
        }
    }
render(){

    var pageNum = [];
    let i , count = 0;
   if( this.state.selectpage){
     

       i=0  ;
    } else{
        i=10;
         pageNum.push(<li className="pagenum f-left" onClick={this.setState({selectpage:true})} > &nbsp;<i className=" fas fa-ellipsis-v"></i></li>)
    }
       

    for(i; i<this.props.noOfpages;i++){
        if(count===10) {   
           break;
        }
        count ++;
        pageNum.push(<li className="pagenum" key={i} data-index={i} onClick={this.props.handleClick}> {i+1} </li>)
    }
    if(this.state.selectpage){
        pageNum.push(<li className="pagenum f-right" onClick={this.setState({selectpage:false})}>&nbsp;<i className=" fas fa-ellipsis-v"></i></li>)
       
    }


    return pageNum ;
}

}

export default pageselector;
